import React from "react";
import UserItem from "./UserItem";
import Card from "../UI/Card/Card";
import "./CSS/UserList.css";

const UserList = () => {
  return (
    <Card>
      <ul>
        <UserItem />
      </ul>
    </Card>
  );
};
export default UserList;
